import './App.css';
import { QueryClientProvider, QueryClient} from 'react-query';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {Negocios} from './pages/Negocios';
import {Negocio} from './pages/Negocio';

import { useEffect, useState } from 'react';
import axios from 'axios';


const queryClient = new QueryClient()


function App() {
  const [name, setName] = useState('')
  const [email, setEmail] = useState('')
  const [description, setDescription] = useState('')
  const postData = (e) => {
      e.preventDefault();
      axios.post('http://127.0.0.1:8000/api/contact',{
          name,
          email,
          description
      }).then(res => console.log('Posting Data', res)).catch(err => console.log(err))
  }
  return (
    <QueryClientProvider client={queryClient}>
      <Router>
      <nav className="bg-white py-8 mb-8 text-right">
        <Link className="text-2xl px-2" to="/"> Inicio </Link>
        <Link className="text-2xl px-2" to="/contacto"> Contacto </Link>


      </nav>

      <Routes>
        <Route path="/" element={<Negocios />} />
        <Route path="/:negocioId" element={<Negocio/>}/>
        <Route path="/contacto" element={<Contacto />} />

      </Routes>
      <footer className="mt-80 h-10 bg-blue-500 h-screen">
      <form>
        <div className="mb-6">
            <label className="block mb-2 text-md font-medium text-gray-900 dark:text-gray-300">Nombre</label>
            <input type="name" value={name} onChange={(e) => setName(e.target.value)} className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required/>
        </div>
        <div className="mb-6">
            <label  className="block mb-2 text-md font-medium text-gray-900 dark:text-gray-300">Email</label>
            <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="name@flowbite.com" required/>
        </div>
        <div className="mb-6">
            <label className="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-300">Descripcion</label>
            <textarea type="description" value={description} onChange={(e) => setDescription(e.target.value)} className="bg-gray-50 border border-gray-300 text-gray-900 text-md rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required/>
        </div>

        <button type="submit" onClick={postData} className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm w-full sm:w-auto px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Submit</button>
      </form>
      </footer>
    </Router>

      </QueryClientProvider>
  );
}

export default App;
